import styled from 'styled-components';

const PrettyHome = styled('div')`
        display: flex;

        width: 80%;
        .genderForm {
            justify-content: center;
            align-items: center;
            width: 50%;
            flex-wrap: wrap
        }
        .categoryForm {
            justify-content: center;
            align-items: center;
            width: 50%;
        }
    @media(max-width: 700px) {
        width: 80%;
        margin-top: 20px;
    }
`;

export default PrettyHome ;
